def update_gidd_disaster_typologies(apps, _):
    Disaster = apps.get_model('gidd', 'Disaster')
    DisasterSubType = apps.get_model('event', 'DisasterSubType')

    disaster_sub_type_map = {
        i.id: i.name for i in DisasterSubType.objects.all()
    }

    updated_disasters = []
    disasters = Disaster.objects.all()
    for disaster in disasters:
        disaster.hazard_sub_type_name = disaster_sub_type_map[disaster.hazard_sub_type_id]
        updated_disasters.append(disaster)

    Disaster.objects.bulk_update(updated_disasters, ['hazard_sub_type_name'])
    print(f'Updated disaster subtype for {len(updated_disasters)} gidd events')


